import React from "react";
import { Dropdown, Form, Button, Header } from "semantic-ui-react";

const options = [
  { key: "1", text: "$", value: "1" },
  { key: "2", text: "$$", value: "2" },
  { key: "3", text: "$$$", value: "3" },
  { key: "4", text: "$$$$", value: "4" }
];

class Price extends React.Component {
  saveAndContinue = e => {
    console.log(this.props.values);
    e.preventDefault();
    this.props.nextStep();
  };

  back = e => {
    e.preventDefault();
    this.props.prevStep();
  };

  render() {
    const { values } = this.props;
    return (
      <Form color="green">
        <Header as="h1" textAlign="center">
          Enter User Details
        </Header>
        <Dropdown
          onChange={this.props.handleChange("price_min")}
          label="Price Range"
          selection
          fluid
          search
          options={options}
          values={values}
          placeholder="Select Minimum"
        />
        <Dropdown
          onChange={this.props.handleChange("price_max")}
          label="Price Range"
          selection
          fluid
          search
          options={options}
          values={values}
          placeholder="Select Maximum"
        />

        <Button onClick={this.back}>Back</Button>
        <Button onClick={this.saveAndContinue}>Save And Continue </Button>
      </Form>
    );
  }
}

export default Price;
